  <div className="flex">
    <Sidebar />
    <main className="flex-1 p-6 bg-gray-50">
      <h1 className="text-2xl font-bold mb-4">Quản lý Menu</h1>
      <Header />
      <FilterBar />
      <MenuTable />
    </main>
  </div>
);

export default MenuManagement;
